import React, {useState} from "react";
import Main from "./components/Main";
import Header from "./components/Header";

function App() {

  const [cartHelper, setCartHelper] = useState(null);

  return (
    <React.Fragment>
      <Header cartHandler={cartHelper}></Header>
      <Main handler={setCartHelper}></Main>
    </React.Fragment>
  );
}

export default App;
